    305 of the Medicare, Medicaid, and SCHIP Benefits Improvement and Protection Act
    of 2000 (Public Law 106-554), authorizes the implementation of a per discharge prospective
    payment system (PPS), through section 1886(j) of the Social Security Act, for inpatient
